import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
let BarChart = require("./BarChart.js");

function App() {
  state = {
    data: [12, 5, 6, 6, 9, 10],
    width: 700,
    height: 500
  };

  render();
  {
    return (
      <div className='App'>
        <BarChart
          data={this.state.data}
          width={this.state.width}
          height={this.state.height}
        />
      </div>
    );
  }
}
export default App;
